import React from "react";
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import {
  Chat,
  EmojiFlags,
  ExpandMoreOutlined,
  LocalHospital,
  People,
  Storefront,
  VideoLibrary
} from "@material-ui/icons";

function Sidebar(){
  return <div className="sidebar">
    <SidebarRow title="Pages"/>
    <SidebarRow
      Icon={LocalHospital}
      title="COVID-19 Information Center"
    />
    <SidebarRow Icon={EmojiFlags} title="Pages" />
    <SidebarRow Icon={People} title="" />
    <SidebarRow Icon={Chat} title="" />
    <SidebarRow Icon={Storefront} title="" />
    <SidebarRow Icon={VideoLibrary} title="" />
    <SidebarRow Icon={ExpandMoreOutlined} title="" />


  </div>
}

export default Sidebar;
